import React, {Component} from 'react';

class YogaGallery extends Component {
    state={
        images: ['doyoga_img_1.jpg', 'doyoga_about_2.jpg', 'doyoga_img_3.jpg', 'doyoga_img_3.jpg', 'doyoga_about_2.jpg',
            'doyoga_about_3.jpg', 'doyoga_about_4.jpg', 'doyoga_img_1.jpg', 'doyoga_about_2.jpg', 'doyoga_about_2.jpg',
            'doyoga_about_4.jpg', 'doyoga_img_3.jpg']
    }
    render() {
        return (
            <div className="yoga-gallery wrapper">
                <h1>YOGA GALLERY</h1>
                <div className="buttons">
                    <button type="button" >All</button>
                    <button type="button" >Classes</button>
                    <button type="button" >Intern</button>
                    <button type="button" >Training</button>
                </div>
            </div>
        );
    }
}

export default YogaGallery;
